import React from "react";

const SlotM = (props) =>{
  // let x = 'smile';
  // let y = 'smile';
  // let z = 'weep';

  // let x = props.x;
  // let y = props.y;
  // let z = props.z;

  if((props.x===props.y) && (props.y===props.z)){
          return(
            <>
            <div className="slot_inner">
              <h1> {props.x} {props.y} {props.z}</h1>
              <h1>This is matching</h1>
              <br />
            </div>
            </>
          );
  }

  else{
    return(
      <>
      <div className="slot_inner">
        <h1> {props.x} {props.y} {props.z}</h1>
        <h1>This is not matching</h1>
        <br />
      </div>
      </>
    );
  }
}

const App2 = () =>{
  return (
      <>
      <h1 className="heading_style">Welcome to <span style={{fontWeight: "bolder"}}>Slot machine</span></h1>
      <div className="slot_mach">
      <SlotM x='smile' y='smile' z='weep'></SlotM>
      <SlotM></SlotM>
      <SlotM></SlotM>
      </div>
      </>
  )
}


export default App2;
